	add("brivla", "{\"term\":\"brivla\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"lojban\"], \"text\":\"From Lojban\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Lojban predicate word. Specifically, a word which may be used to express a selbri relation (a statement of truth of one kind or another) between a number of arguments. Gismu, lujvo and fu\u0027ivla are all brivla\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;i\u0026gt;\u0027\u0027Brivla\u0027\u0027 are \u0026quot;content words\u0026quot;, i.e., categorematic. When acting as selbri they are roughly comparable to verbs (or adjectives (or even nouns), if the selbri\u0027s arity is one), and when acting as sumti (e.g., due to being prefixed with \u0026quot;le\u0026quot;) they are comparable to nouns. If a \u0027\u0027brivla\u0027\u0027 modifies another one (thereby forming a \u0026quot;tanru\u0026quot;), the modifying \u0027\u0027brivla\u0027\u0027 would be comparable to an adverb or adjective (*), depending on whether the modified \u0027\u0027brivla\u0027\u0027 is acting as selbri or sumti, respectively. // Footnote: (*) - the modifying brivla could instead be comparable, in some cases, to the modified brivla\u0027s predicate.\u0026lt;/i\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1997,\u0027\u0027 John W. Cowan, \u0027The Complete Lojban Language\u0027 ISBN 0966028309 [http://www.lojban.org/tiki/tiki-download_wiki_attachment.php?attId\u003d194\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They often have no semantic meaning in themselves, though they may affect the semantics of \u0027\u0027brivla\u0027\u0027 to which they are attached\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a.\u0027\u0027 \u0027\u00272001,\u0027\u0027 Richard Curnow [http://www.rpcurnow.force9.co.uk/jbofihe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Fix major bugs in the lexical analysis for cmafi\u0027e (\u0027\u0027brivla\u0027\u0027 mis-scanned as sequences of cmavo joined together\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a.\u0027\u0027 \u0027\u00272003,\u0027\u0027 Pierre Abbat [http://phma.hn.org/Language/valfendi.html] [http://web.archive.org/web\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"http://phma.hn.org/Language/valfendi.html\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Currently, it lexes cmene, cmavo, and \u0027\u0027brivla\u0027\u0027, and checkes [\u0027sic\u0027] cmene and cmavo for validity, but does not do full validity checking of \u0027\u0027brivla\", \"priority\":9}]}, \"synonyms\":{}}");

